import fetch from '../lib/fetch';

const generateToken = async (name) => {
    let res = null;

    try{
        let resp = await fetch.fetchGet(`http://137.184.158.1/api/twilio/generate-jwt?identity=${name}`);
        console.log(resp);
        res = resp.data;
    } catch (err){
        console.log(err);
    }
    return res;
}

const funcs = {
    generateToken
}

export default funcs;
